<div id="pf2" class="pf w0 h0" data-page-no="2"><div class="pc pc2 w0 h0"><img class="bi x0 y0 w0 h0" alt="" src="data:image/png;base64,"/><div class="t m1 x23 hd y6f ff5 fs7 fc1 sc0 ls0 ws0">File and Pay Online to Receive a Collection <span class="_ _3"></span>Allowance.<span class="ff2"> When you electronically le your tax return and pay timely<span class="_ _2"></span>, you are entitled </span></div><div class="t m1 x23 hd y70 ff2 fs7 fc1 sc0 ls0 ws0">to deduct a collection allowance of 2.5% (.025) of the rst $1,200 of tax due, not to exceed $30. T<span class="_ _1"></span>o pay timely<span class="_ _2"></span>, you must initiate </div><div class="t m1 x23 hd y71 ff2 fs7 fc1 sc0 ls0 ws0">payment and receive a conrmation number<span class="_ _3"></span>, no later than 5:00 p.m. ET<span class="_ _3"></span> on the business day prior to the 20th. More information on </div><div class="t m1 x23 hd y72 ff2 fs7 fc1 sc0 ls0 ws0">ling and paying electronically<span class="_ _2"></span>, including a <span class="ff4">Florida eServices Calendar of Electronic Payment Deadlines</span> (Form DR-659), is available at </div><div class="t m1 x23 h8 y73 ff5 fs7 fc1 sc0 ls0 ws0">oridarevenue.com<span class="ff3">.</span></div><div class="t m1 x23 hd y74 ff1 fs7 fc1 sc0 ls0 ws0">Due Dates. <span class="ff2">Returns and payments are</span> due on the 1st and late after the 20th day of the month <span class="ff2">following each reporting period.</span></div><div class="t m1 x23 hd y75 ff5 fs7 fc1 sc0 ls0 ws0">A<span class="_ _3"></span> return must be led for each reporting period, even if no tax is due. <span class="ff2">If the 20th falls on a Saturday<span class="_ _2"></span>, Sunday<span class="_ _2"></span>, or a state or federal </span></div><div class="t m1 x23 hd y76 ff2 fs7 fc1 sc0 ls0 ws0">holiday<span class="_ _2"></span>, returns are timely if postmarked or hand delivered on the rst business day following the 20th.</div><div class="t m1 x23 hd y77 ff1 fs7 fc1 sc0 ls0 ws0">Penalty<span class="_ _2"></span>.<span class="ff2"> If you le your return or pay tax late, a late penalty of 10% of the amount of tax owed, but not less than $50, may be charged. </span></div><div class="t m1 x23 hd y78 ff2 fs7 fc1 sc0 ls0 ws0">The $50 minimum penalty applies even if no tax is due. <span class="_ _3"></span>A<span class="_ _2"></span> oating rate of interest also applies to late payments and underpayments of </div><div class="t m1 x23 hd y79 ff2 fs7 fc1 sc0 ls0 ws0">tax.</div><div class="t m1 x24 ha y7a ff3 fs6 fc2 sc0 ls0 ws0"> <span class="_ _16"> </span> <span class="_ _17"> </span> <span class="_ _18"> </span> </div><div class="t m1 x24 h7 y7b ff3 fs6 fc2 sc0 ls0 ws0"> <span class="_ _19"> </span><span class="ff2 fc1">Signature of T<span class="_ _2"></span>axpayer<span class="ff3 fc2"> <span class="_ _14"> </span></span>Date<span class="ff3 fc2"> <span class="_ _1a"> </span></span>Signature of Preparer<span class="ff3 fc2"> <span class="_ _1b"> </span></span>Date</span></div><div class="t m1 x24 h7 y7c ff3 fs6 fc1 sc0 ls0 ws0"> <span class="_ _1c"></span><span class="ff2 fc2">( ___________ ) ______________________________________ <span class="_ _1d"> </span> <span class="_ _1e"> </span>( ___________ ) _______________________________________</span></div><div class="t m1 x24 h7 y7d ff3 fs6 fc2 sc0 ls0 ws0"> <span class="_ _1f"> </span><span class="ff2 fc1">T<span class="_ _2"></span>elephone Number <span class="_ _20"> </span> <span class="_ _9"> </span>T<span class="_ _2"></span>elephone Number</span></div><div class="t m1 x25 he y7e ff2 fs9 fc1 sc0 ls0 ws0">Under penalties of perjury<span class="_ _2"></span>, I declare that I have read this return and the facts stated in it are true.</div><div class="t m1 x26 hf y7f ff1 fsa fc1 sc0 ls0 ws0">16.<span class="ff3"> <span class="_ _21"> </span><span class="ff5">Florida T<span class="_ _3"></span>ax Credit Scholarship Program Motor V<span class="_ _2"></span>ehicle Sales T<span class="_ _